0022../input/\u0022 directory.\n# For example, running this (by clicking run or pressing Shift+Enter) will list the files in the input directory\n# Any results you write to the current directory are saved as output.\n\n\n################################\n# First half of the code does basic preprocessing\n# Second half of the code does deep learning\n\n\nlibrary(keras)\nlibrary(kyotil)\nempty2na=function(x) {x[x==\u0022\u0022]=NA; x = as.factor(as.character(x))}\n\npwd=\u0022../input\u0022\n\ndat=read.csv(file=pwd%+%\u0022/train.csv\u0022,stringsAsFactors =T)\nnames(dat)=tolower(names(dat))\ndat.test=read.csv(file=pwd%+%\u0022/test.csv\u0022,stringsAsFactors =T)\nnames(dat.test)=tolower(names(dat.test))\nsummary(dat)\nsummary(dat.test)\n\n# missing data\ndat$embarked=empty2na(dat$embarked)\ndat$cabin=empty2na(dat$cabin)\ndat.test$cabin=empty2na(dat.test$cabin)\n\n# rename some colums\nnames(dat)[names(dat)==\u0022survived\u0022]=\u0022y\u0022\n\n# fill in missing values for age and embarked\n# in train data age is missing for 177, embarked is missing for 2\n# in test data age is missing for 86\ndat$age.1=dat$age; dat$age.1[is.na(dat$age.1)]=median(dat$age,na.rm=T)\ndat$embarked.1=dat$embarked; dat$embarked.1[is.na(dat$embarked.1)]=\u0022S\u0022\ndat.test$age.1=dat.test$age; dat.test$age.1[is.na(dat.test$age.1)]=median(dat.test$age,na.rm=T)\ndat.test$embarked.1=dat.test$embarked\n\n# derived column\n# train data\ndat$ticket.share=table(dat$ticket)[dat$ticket] # number of people who share a ticket\ndat$fare0=dat$fare==0; dat$lfare=log(1+dat$fare)\ndat$pclass.f=as.factor(dat$pclass)\ndat$class_gender=factor(paste(\u0022class\u0022%+%dat$pclass, dat$sex,sep=\u0022_\u0022))\n\n# test data\ndat.test$pclass.f=as.factor(dat.test$pclass)\ndat.test$fare0=dat.test$fare==0; dat.test$lfare=log(1+dat.test$fare)\ndat.test$fare0[is.na(dat.test$fare0)]=FALSE; dat.test$lfare[is.na(dat.test$lfare)]=median(dat.test$lfare, na.rm=T)\ndat.test$ticket.share=table(dat.test$ticket)[dat.test$ticket] # number of people who share a ticket\n\nsave(dat, dat.test, file=\u0022titanic.Rdata\u0022)\n\n# sex, pclass\n# age\n# sibsp parch\n# fare \n# embarked\n# cabin \n# name\n# ticket \n\n##################################################\n# Deep learning model 1\n\nx_train=model.matrix(~ pclass.f + sex + age.1 + sibsp + embarked.1 + fare0 + lfare + parch + ticket.share, dat) [,-1] \ny_train \u003c- to_categorical(dat$y, 2)\n\nver=6; seed=6; epo=295\n    use_session_with_seed(seed, disable_gpu = FALSE, disable_parallel_cpu = FALSE)\n    \n    model \u003c- keras_model_sequential() \n    model %\u003e% \n      layer_dense(units = 128, activation = \u0027relu\u0027, input_shape = c(ncol(x_train))) %\u003e% \n      layer_dropout(rate = 0.5) %\u003e% \n      layer_dense(units = 128, activation = \u0027relu\u0027) %\u003e%\n      layer_dropout(rate = 0.5) %\u003e%\n      layer_dense(units = 128, activation = \u0027relu\u0027) %\u003e%\n      layer_dropout(rate = 0.4) %\u003e%\n      layer_dense(units = 2, activation = \u0027softmax\u0027)\n    summary(model)\n    \n    model %\u003e% compile(\n      loss = \u0027categorical_crossentropy\u0027,\n      optimizer = optimizer_rmsprop(),\n      metrics = c(\u0027accuracy\u0027)\n    )\n    \n    history \u003c- model %\u003e% fit(\n      x_train, y_train, \n      epochs = epo, batch_size = nrow(dat)*0.8, \n      validation_split = 0.2\n    )\n    \n    mypdf(file=\u0022dl_v\u0022%+%ver%+%\u0022_history_seed\u0022%+%seed%+%\u0022_epoch\u0022%+%epo)\n        plot(history$metrics$acc,       col=\u0022red\u0022, type=\u0022l\u0022, ylim=c(0.75,1), ylab=\u0022loss\u0022, xlab=\u0022epoch\u0022)\n        lines(history$metrics$val_acc, col=\u0022blue\u0022)\n    dev.off()\n\npred.train \u003c- model %\u003e% predict_classes(x_train)\nmodel %\u003e% evaluate(x_train, y_train)\n\n\n# how to save model from previous epochs? not sure. for now, the workaround is to train to the desired epoch\nx_test=model.matrix(~ pclass.f + sex + ag $age.1[is.na(dat.test$age.1)]=median(dat.test$age,na.rm=T)\ndat.test$embarked.1=dat.test$embarked\n\n# derived column\n# train data\ndat$ticket.share=table(dat$ticket)[dat$ticket] # number of people who share a ticket\ndat$fare0=dat$fare==0; dat$lfare=log(1+dat$fare)\ndat$pclass.f=as.factor(dat$pclass)\ndat$class_gender=factor(paste(\u0022class\u0022%+%dat$pclass, dat$sex,sep=\u0022_\u0022))\n\n# test data\ndat.test$pclass.f=as.factor(dat.test$pclass)\ndat.test$fare0=dat.test$fare==0; dat.test$lfare=log(1+dat.test$fare)\ndat.test$fare0[is.na(dat.test$fare0)]=FALSE; dat.test$lfare[is.na(dat.test$lfare)]=median(dat.test$lfare, na.rm=T)\ndat.test$ticket.share=table(dat.test$ticket)[dat.test$ticket] # number of people who share a ticket\n\nsave(dat, dat.test, file=\u0022titanic.Rdata\u0022)\n\n# sex, pclass\n# age\n# sibsp parch\n# fare \n# embarked\n# cabin \n# name\n# ticket \n\n##################################################\n# Deep learning model 1\n\nx_train=model.matrix(~ pclass.f + sex + age.1 + sibsp + embarked.1 + fare0 + lfare + parch + ticket.share, dat) [,-1] \ny_train \u003c- to_categorical(dat$y, 2)\n\nver=6; seed=6; epo=295\n    use_session_with_seed(seed, disable_gpu = FALSE, disable_parallel_cpu = FALSE)\n    \n    model \u003c- keras_model_sequential() \n    model %\u003e% \n      layer_dense(units = 128, activation = \u0027relu\u0027, input_shape = c(ncol(x_train))) %\u003e% \n      layer_dropout(rate = 0.5) %\u003e% \n      layer_dense(units = 128, activation = \u0027relu\u0027) %\u003e%\n      layer_dropout(rate = 0.5) %\u003e%\n      layer_dense(units = 128, activation = \u0027relu\u0027) %\u003e%\n      layer_dropout(rate = 0.4) %\u003e%\n      layer_dense(units = 2, activation = \u0027softmax\u0027)\n    summary(model)\n    \n    model %\u003e% compile(\n      loss = \u0027categorical_crossentropy\u0027,\n      optimizer = optimizer_rmsprop(),\n      metrics = c(\u0027accuracy\u0027)\n    )\n    \n    history \u003c- model %\u003e% fit(\n      x_train, y_train, \n      epochs = epo, batch_size = nrow(dat)*0.8, \n      validation_split = 0.2\n    )\n    \n    mypdf(file=\u0022dl_v\u0022%+%ver%+%\u0022_history_seed\u0022%+%seed%+%\u0022_epoch\u0022%+%epo)\n        plot(history$metrics$acc,       col=\u0022red\u0022, type=\u0022l\u0022, ylim=c(0.75,1), ylab=\u0022loss\u0022, xlab=\u0022epoch\u0022)\n        lines(history$metrics$val_acc, col=\u0022blue\u0022)\n    dev.off()\n\npred.train \u003c- model %\u003e% predict_classes(x_train)\nmodel %\u003e% evaluate(x_train, y_train)\n\n\n# how to save model from previous epochs? not sure. for now, the workaround is to train to the desired epoch\nx_test=model.matrix(~ pclass.f + sex + age.1 + sibsp + embarked.1 + fare0 + lfare + parch + ticket.share, dat.test) [,-1] \npred \u003c- model %\u003e% predict_classes(x_test)\nmywrite.csv(cbind(PassengerId=dat.test$passengerid, Survived=pred), file=\u0022DL1_submission\u0022)\n\n\n\n\n##################################################\n# Deep learning model 1\n\nx_train=model.matrix(~ pclass.f + sex + age.1 + sibsp + embarked.1, dat)     [,-1] \ny_train \u003c- to_categorical(dat$y, 2)\n\nver=1; seed=1; epo=300\n    use_session_with_seed(seed, disable_gpu = FALSE, disable_parallel_cpu = FALSE)\n    \n    model \u003c- keras_model_sequential() \n    model %\u003e% \n      layer_dense(units = 256, activation = \u0027relu\u0027, input_shape = c(ncol(x_train))) %\u003e% \n      layer_dropout(rate = 0.4) %\u003e% \n      layer_dense(units = 128, activation = \u0027relu\u0027) %\u003e%\n      layer_dropout(rate = 0.3) %\u003e%\n      layer_dense(units = 2, activation = \u0027softmax\u0027)\n    summary(model)\n    \n    model %\u003e% compile(\n      loss = \u0027categorical_crossentropy\u0027,\n      optimizer = optimizer_rmsprop(),\n      metrics = c(\u0027accuracy\u0027)\n    )\n    \n    history \u003c- model %\u003e% fit(\n      x_train, y_train, \n      epochs = epo, batch_size = nrow(dat)*0.8, \n      validation_split = 0.2\n    )\n\nmodel %\u003e% evaluate(x_train, y_train)\n\n\n# how to save model from previous epochs? not sure. for now, the workaround is to train to the desired epoch\nx_test=model.matrix(~ pclass.f + sex + age.1 + sibsp + embarked.1, dat.test) [,-1] \npred \u003c- model %\u003e% predict_classes(x_test)\nmywrite.csv(cbind(PassengerId=dat.test$passengerid, Survived=pred), file=\u0022DL2_submission\u0022)\n","dateCreated":"2017-11-13T18:04:20.29Z"},"resources":null,"isolatorResults":"\u003cresults\u003e\u003cdisk_kb_free\u003e945352\u003c/disk_kb_free\u003e\u003cdocker_image_id\u003esha256:968814ffd2b807bb8dcb6d74fed7ee2dcc7753a6e2913a5c7c5db722f67ffc23\u003c/docker_image_id\u003e\u003cdocker_image_name\u003ekaggle/rstats\u003c/docker_image_name\u003e\u003cexit_code\u003e0\u003c/exit_code\u003e\u003cfailure_message /\u003e\u003cout_of_memory\u003eFalse\u003c/out_of_memory\u003e\u003crun_time_seconds\u003e13.3595959729282\u003c/run_time_seconds\u003e\u003csucceeded\u003eTrue\u003c/succeeded\u003e\u003ctimeout_exceeded\u003eFalse\u003c/timeout_exceeded\u003e\u003cused_all_space\u003eFalse\u003c/used_all_space\u003e\u003cwas_killed\u003eFalse\u003c/was_killed\u003e\u003c/results\u003e","runInfo":{"dockerfileUrl":"https://github.com/Kaggle/docker-rstats/blob/master/Dockerfile","dockerHubUrl":"https://registry.hub.docker.com/u/kaggle/rstats/","dockerImageDigest":null,"dockerImageId":"sha256:968814ffd2b807bb8dcb6d74fed7ee2dcc7753a6e2913a5c7c5db722f67ffc23","dockerImageName":"kaggle/rstats","diskKbFree":945352,"failureMessage":"","exitCode":0,"queuedSeconds":0,"outputSizeBytes":0,"runTimeSeconds":13.3595959729282,"usedAllSpace":false,"timeoutExceeded":false,"isValidStatus":false,"wasGpuEnabled":false,"wasInternetEnabled":false,"outOfMemory":false,"invalidPathErrors":false,"succeeded":true,"wasKilled":false},"outputFilesTotalSizeBytes":68927,"dockerImageVersionId":null,"usedCustomDockerImage":false},"author":{"id":1399099,"displayName":"Youyi","email":null,"editedEmail":n null,"remoteGithubSettings":null},"render":null,"children":[],"name":"","description":null}],"name":"train.csv","description":"contains data \n"}],"name":"Titanic: Machine Learning from Disaster","description":"\u003ch3\u003eOverview\u003c/h3\u003e\n\u003cp\u003eThe data has been split into two groups:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003etraining set (train.csv)\u003c/li\u003e\n\u003cli\u003etest set (test.csv)\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003e\u003cb\u003e The training set \u003c/b\u003eshould be used to build your machine learning models. For the training set, we provide the outcome (also known as the ground truth) for each passenger. Your model will be based on features like passengers gender and class. You can also use \u003ca href=\u0022https://triangleinequality.wordpress.com/2013/09/08/basic-feature-engineering-with-the-titanic-data/\u0022 target=\u0022_blank\u0022\u003e feature engineering \u003c/a\u003eto create new features.\u003c/p\u003e\n\u003cp\u003e\u003cb\u003eThe test set \u003c/b\u003eshould be used to see how well your model performs on unseen data. For the test set, we do not provide the ground truth for each passenger. It is your job to predict these outcomes. For each passenger in the test set, use the model you trained to predict whether or not they survived the sinking of the Titanic.\u003c/p\u003e\n\u003cp\u003eWe also include \u003cb\u003egender_submission.csv\u003c/b\u003e, a set of predictions that assume all and only female passengers survive, as an example of what a submission file should look like.\u003c/p\u003e\n\u003ch3\u003eData Dictionary\u003c/h3\u003e\n\u003ctable style=\u0022width: 100%;\u0022\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\u003cth\u003e\u003cb\u003eVariable\u003c/b\u003e\u003c/th\u003e\u003cth\u003e\u003cb\u003eDefinition\u003c/b\u003e\u003c/th\u003e\u003cth\u003e\u003cb\u003eKey\u003c/b\u003e\u003c/th\u003e\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esurvival\u003c/td\u003e\n\u003ctd\u003eSurvival\u003c/td\u003e\n\u003ctd\u003e0 = No, 1 = Yes\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003epclass\u003c/td\u003e\n\u003ctd\u003eTicket class\u003c/td\u003e\n\u003ctd\u003e1 = 1st, 2 = 2nd, 3 = 3rd\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esex\u003c/td\u003e\n\u003ctd\u003eSex\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eAge\u003c/td\u003e\n\u003ctd\u003eAge in years\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esibsp\u003c/td\u003e\n\u003ctd\u003e# of siblings / spouses aboard the Titanic\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eparch\u003c/td\u003e\n\u003ctd\u003e# of parents / children aboard the Titanic\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eticket\u003c/td\u003e\n\u003ctd\u003eTicket number\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003efare\u003c/td\u003e\n\u003ctd\u003ePassenger fare\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003ecabin\u003c/td\u003e\n\u003ctd\u003eCabin number\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eembarked\u003c/td\u003e\n\u003ctd\u003ePort of Embarkation\u003c/td\u003e\n\u003ctd\u003eC = Cherbourg, Q = Queenstown, S = Southampton\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n\u003ch3\u003eVariable Notes\u003c/h3\u003e\n\u003cp\u003e\u003cb\u003epclass\u003c/b\u003e: A proxy for socio-economic status (SES)\u003cbr /\u003e 1st = Upper\u003cbr /\u003e 2nd = Middle\u003cbr /\u003e 3rd = Lower\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003eage\u003c/b\u003e: Age is fractional if less than 1. If the age is estimated, is it in the form of xx.5\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003esibsp\u003c/b\u003e: The dataset defines family relations in this way...\u003cbr /\u003e Sibling = brother, sister, stepbrother, stepsister\u003cbr /\u003e Spouse = husband, wife (mistresses and fiancs were ignored)\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003eparch\u003c/b\u003e: The dataset defines family relations in this way...\u003cbr /\u003e Parent = mother, father\u003cbr /\u003e Child = daughter, son, stepdaughter, stepson\u003cbr /\u003e Some children travelled only with a nanny, therefore parch=0 for them.\u003c/p\u003e"}],"versions":[{"id":1746109,"kernelVersionId":null,"isForkParent":false,"isNotebook":false,"languageName":"R","lastRunTime":"2017-11-13T18:04:20.29Z","linesChangedFromPrevious":0,"linesDeletedFromPrevious":0,"linesInsertedFromPrevious":37,"outputFilesTotalSizeBytes":0,"runInfo":{"dockerfileUrl":"https://github.com/Kaggle/docker-rstats/blob/master/Dockerfile","dockerHubUrl":"https://registry.hub.docker.com/u/kaggle/rstats/","dockerImageId":"sha256:968814ffd2b807bb8dcb6d74fed7ee2dcc7753a6e2913a5c7c5db722f67ffc23","dockerImageName":"kaggle/rstats","exitCode":0,"failureMessage":"","isValidStatus":true,"runTimeSeconds":13.3595959729282,"succeeded":true,"timeoutExceeded":false,"usedAllSpace":false},"status":"complete","title":"Titanic DL","url":"/youyifong/titanic-dl?scriptVersionId=1746109","versionNumber":14,"hasVersionNumber":true,"isRedacted":false,"versionAuthor":null},{"id":1746105,"kernelVersionId":null,"isForkParent":false,"isNotebook":false,"languageName":"R","lastRunTime":"2017-11-13T18:03:17.343Z","linesChangedFromPrevious":0,"linesDeletedFromPrevious":2,"linesInsertedFromPrevious":0,"outputFilesTotalSizeBytes":0,"runInfo":{"dockerfileUrl":"https://github.com/Kaggle/docker-rstats/blob/master/Dockerfile","dockerHubUrl":"https://registry.hub.docker.com/u/kaggle/rstats/","dockerImageId":"sha256:968814ffd2b807bb8dcb6d74fed7ee2dcc7753a6e2913a5c7c5db722f67ffc23","dockerImageName":"kaggle/rstats","exitCode":0,"failureMessage":"","isValidStatus":true,"runTimeSeconds":8.92841274396051,"su
